  {
    pid: 252,
    lpSymbol: 'BUSD-BNB LP',
    lpAddresses: {
      81457: ' 0xc715cB6E8A172473d56221218586cCea6b33428a',
      97: '',      
      56: '0x58F876857a02D6762E0101bb5C46A8c1ED44Dc16', //  USDB - ETH LP
    },
    token: tokens.busd,
    quoteToken: tokens.wbnb,
  },

]

